import React, { useEffect, useState } from 'react'
import axios from 'axios'
import './Home.css'
import { Link } from 'react-router-dom'
import { useLocation, useNavigate } from 'react-router-dom';
import HomeContent from './HomeContent';
import RegisCouncelling from './RegisCouncelling'
import Analysis from './Analysis'
import AboutUs from './AboutUs';
import Profile from '../assets/img/profile-user.png'
import Logo from '../assets/img/carecube.png'
import Preloader from './Preloader';

const Home = () => {
  const [user, setUser] = useState(null)
  const userId = (useLocation().pathname).split('/')[2];
  const [activeButton, setActiveButton] = useState("homecontent");
  const navigate = useNavigate()

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const user = await axios.post('http://localhost:4000/getUser', {
          userId: userId
        });
        setUser(user.data.detail)
      } catch (err) {
        console.log(err);
      }
    }
    fetchUser()
  }, [userId])

  const handleButtonClick = (buttonName) => {
    setActiveButton(buttonName);
    if (buttonName === "logout") {
      navigate("/login");
    }
  };

  return (
    <div className="app-container" style={{ marginTop: "10px", width: "100%", height: "100%" }}>
      {/* App Header */}
      <div className="app-header" style={{ width: "100%", height: "15vh" }}>
        <div className='app-header-left'>
          <img src={Logo} style={{ width: "140px", height: "100px", marginTop: "15px" }} alt="Logo" />
        </div>
        <div className='app-header-right'>
          <img src={Profile} alt="Profile" style={{ width: "50px" }} />
          <div>{user && user.username}</div>
        </div>
      </div>

      {/* App Content */}
      <div className="app-content" style={{ width: "100%", height: "85vh" }}>
        <div className="app-sidebar">
          <button
            className={activeButton === "homecontent" ? "active" : ""}
            onClick={() => handleButtonClick("homecontent")}
          >
            Home
          </button>
          <Link to={'therapy'}>
            <button
              className={activeButton === "therapy" ? "active" : ""}
              onClick={() => handleButtonClick("therapy")}
            >
              Therapy
            </button>
          </Link>
          <button
            className={activeButton === "councelling" ? "active" : ""}
            onClick={() => handleButtonClick("councelling")}
          >
            Counseling
          </button>
          <button
            className={activeButton === "analysis" ? "active" : ""}
            onClick={() => handleButtonClick("analysis")}
          >
            Analysis
          </button>
          <button
            className={activeButton === "aboutus" ? "active" : ""}
            onClick={() => handleButtonClick("aboutus")}
          >
            About Us
          </button>
        </div>

        <div className="projects-section" style={{}}>
          <div className="projects-section-header">
            <p></p>
            <p className="time"></p>
          </div>

          <div className="project-boxes jsGridView" style={{ width: "850px", height: "700px", marginBottom: "60px", overflow: "auto" }}>
            {/* Bootstrap Carousel */}
            <div id="myCarousel" className="carousel slide" data-ride="carousel">
              {/* Indicators */}
              <ol className="carousel-indicators">
                <li data-target="#myCarousel" data-slide-to="0" className="active"></li>
                <li data-target="#myCarousel" data-slide-to="1"></li>
                <li data-target="#myCarousel" data-slide-to="2"></li>
              </ol>

              {/* Wrapper for slides */}
              <div className="carousel-inner">
                {/* First Image */}
                <div className="item active">
                  <img src="../path_to_your_first_image.jpg" alt="First slide" style={{ width: "100%" }} />
                </div>

                {/* Second Image */}
                <div className="item">
                  <img src="../path_to_your_second_image.jpg" alt="Second slide" style={{ width: "100%" }} />
                </div>

                {/* Third Image */}
                <div className="item">
                  <img src="../path_to_your_third_image.jpg" alt="Third slide" style={{ width: "100%" }} />
                </div>
              </div>

              {/* Left and right controls */}
              <a className="left carousel-control" href="#myCarousel" data-slide="prev">
                <span className="glyphicon glyphicon-chevron-left"></span>
                <span className="sr-only">Previous</span>
              </a>
              <a className="right carousel-control" href="#myCarousel" data-slide="next">
                <span className="glyphicon glyphicon-chevron-right"></span>
                <span className="sr-only">Next</span>
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Home
